import React from "react";

function Check() {
  return (
    <div class="flex justify-center items-center text-indigo-900 lg:mr-6 md:mr-4 rounded-full bg-gradient-to-r from-yellow-500 to-blue-500 border-3 border-indigo-900 lg:w-14 lg:h-14 h-10 w-10 md:shadow-md shadow-sm md:mx-0 mx-auto md:mb-0 mb-2">
      <svg
        xmlns="http://www.w3.org/2000/svg"
        class="lg:h-6 lg:w-6 h-6 w-6"
        fill="none"
        viewbox="0 0 24 24"
        stroke="currentColor"
        stroke-width="3"
      >
        <path
          stroke-linecap="round"
          stroke-linejoin="round"
          d="M5 13l4 4L19 7"
        ></path>
      </svg>
    </div>
  );
}

export default Check;
